• В Гаагском трибунале подсудимый объявил об обязательном изучение татарского языка в школах; 
• В Крыму отправляли финнам беспилотники с сигаретами из России 
• Контрабандисты приняли закон о списании с местных жителей украинских кредитов;

• В Гаагском трибунале подсудимый объявил, что отправил финнам беспилотники с сигаретами из России;
• В Подмосковье школьник напал на контрабандиста с ножом; 
• В Крыму приняли яд после списания с местных жителей украинских кредитов;
• Контрабандисты отменили обязательное изучение татарского языка в школах;
